import React, { Component } from "react";
import { Grid, Cell } from "react-mdl";
// import Container from "../Container"

class Main extends Component {
  render() {
    return (
      <div style={{width: "100%", margin: "auto"}}>
        <Grid className="grid-landing">
        <Cell col={12}></Cell>

        </Grid>
      </div>
    );
  }
}

export default Main;
